import React from 'react'
import Home from './Home'
import Welcome from './Welcome';
import Data from './Data';

function App() {
  function dyn(val){
    <Welcome
      name = {val.name}
      age = {val.age}
    />
}

  return (

    <>



      {Data.map(dyn)}
    </>
  );
}

export default App;
